import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // First add an item to cart to ensure we have something to update
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child .add-to-cart');

    // Wait for cart counter to update
    await page.waitForFunction(() => {
      const cartCount = document.querySelector('.cart-count');
      return cartCount && cartCount.textContent !== '0';
    }, { timeout: 5000 });

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Update quantity by clicking the increase button
    await page.waitForSelector('.cart-item-quantity button:last-child', { timeout: 5000 });
    await page.click('.cart-item-quantity button:last-child');

    // Wait for quantity to update
    await page.waitForFunction(() => {
      const quantity = document.querySelector('.cart-item-quantity .quantity');
      return quantity && quantity.textContent === '2';
    }, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract updated cart data
    const extractedData = await page.evaluate(() => {
      const quantity = document.querySelector('.cart-item-quantity .quantity');
      const total = document.querySelector('.cart-total');
      return {
        quantity: quantity ? quantity.textContent : null,
        total: total ? total.textContent : null
      };
    });

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 2",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
